  input: TEXT,F3XN,,"Dear Mr. Koeppen,  On behalf of the Motorola, Inc. Political
    Action Committee, I am hereby submitting this explanatory statement with our September
    Monthly Report.  On August 14th and 28th, an error in our payroll system caused
    two erroneous deductions from one of our PAC contributors.  More specifically,
    the amount of $5,000 was deducted from Raymond Roman on 8/14/03.  Mr. Roman immediately
    contacted our payroll department regarding this error and received an electronic
    credit of $4,947.12 on 8/28/03.  Please note that $4,947.12 reflects the difference
    of his intended contribution of $53.88.  Subsequently, an additional deduction
    of $4,947.12 was taken from his pay on 8/28/03.  To correct this erroneous deduction,
    $4,894.24 (less his $53.88 intended contribution) was electronically credited
    to his account on 9/11/03.  Since a check was not cut from the PAC bank account,
    the payroll department transmitted the electronic credits as negative entries
    in our monthly payroll file.  Per our September 9th conversation with Scott Walker,
    Senior Campaign Finance Analyst, disclosing the negative deduction representing
    the EFT transfer was sufficient clarification for the public record.  Please note
    that the corrective action for this error will appear on both our September Monthly
    and October Monthly Reports.  Furthermore, we are continuing to review this matter
    to ensure no other contributors experienced such erroneous deductions.  If you
    have any questions, please do not hesitate to contact me at (847) 576-5306.  Respectfully
    submitted, Bruce Forsberg, PAC Treasurer "
